/* Componente para ajudar a compreender o conceito de children e a sua relação com React.ReactNode */

type Props = {
  price: number;
  children: React.ReactNode;
};

const TestChildren = ({ price, children }: Props) => {
  return (
    <>
      {children}
      <h1>Preço = {price}</h1>
      {children}
    </>
  );
};

export default TestChildren;
